import React, { useState } from 'react';

const UserDashboard = () => {
 

  const styles = {
    dashboard: {
      fontFamily: "'Poppins', sans-serif", // Updated for a more modern font
      textAlign: 'center',
      padding: '20px',
      backgroundColor: '#f0f4f7', // Softer background
      height: '100vh',
      color: '#333' // Primary text color
    },
    header: {
      backgroundColor: '#2a2a2a', // Dark grey background for a sleek look
      padding: '20px 40px', // Added more padding
      color: 'white',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    },
    nav: {
      display: 'flex',
      justifyContent: 'flex-end',
      marginRight: '20px',
      position: 'relative',
      alignItems: 'center'
    },
    navLink: {
      color: 'white',
      margin: '0 15px',
      textDecoration: 'none',
      position: 'relative',
      cursor: 'pointer',
      fontWeight: 'bold',
      padding: '10px 15px', // Added padding for better clickable area
      borderRadius: '8px', // Rounded edges for links
      transition: 'background-color 0.3s ease'
    },
    navLinkHover: {
      backgroundColor: '#444' // Darker background on hover
    },
    dropdownMenu: {
      position: 'absolute',
      top: '100%',
      left: 0,
      backgroundColor: '#333',
      borderRadius: '8px',
      padding: '10px',
      zIndex: 1,
      display: 'none',
      boxShadow: '0px 4px 12px rgba(0,0,0,0.1)', // Added shadow for dropdown
    },
    dropdownMenuOpen: {
      display: 'block'
    },
    dropdownItem: {
      color: 'white',
      padding: '10px 15px',
      textDecoration: 'none',
      display: 'block',
      backgroundColor: '#444',
      margin: '5px 0',
      borderRadius: '4px',
      transition: 'background-color 0.3s ease',
    },
    dropdownItemHover: {
      backgroundColor: '#555' // Darker background on hover
    },
    metrics: {
      display: 'flex',
      justifyContent: 'space-around',
      margin: '40px 0',
      padding: '20px 0',
      backgroundColor: '#fff', // White background for the metrics area
      boxShadow: '0px 6px 16px rgba(0, 0, 0, 0.1)', // Soft shadow for the metrics section
      borderRadius: '12px'
    },
    metric: {
      backgroundColor: '#fff',
      padding: '20px',
      borderRadius: '12px',
      width: '200px',
      boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)', // Card-like style for metrics
      textAlign: 'center'
    },
    metricHeader: {
      fontSize: '18px',
      fontWeight: '600',
      marginBottom: '10px',
      color: '#555'
    },
    metricValue: {
      fontSize: '24px',
      fontWeight: 'bold',
      color: '#2a2a2a'
    }
  };

  return (
    <div style={styles.dashboard}>
      <header style={styles.header}>
        <h1>Online Medical Shop user</h1>
        <nav style={styles.nav}>
          <a href="Home" style={styles.navLink}>Home</a>
          <a href="#" style={styles.navLink}>View Booking</a>
          <a href="#" style={styles.navLink}>View product</a>
          <a href="#" style={styles.navLink}>View Feedback</a>
          <a href="#" style={styles.navLink}>ChangePassword</a>

          <a href="/" style={styles.navLink}>Logout</a>
        </nav>
      </header>
      </div>
  );
};

export default UserDashboard;
